import React, { useEffect } from "react";
import "./App.css";
import Layout from "./components/Layout/Layout";
import AOS from "aos";
import "aos/dist/aos.css";

function App() {
  useEffect(() => {
    AOS.init();
    AOS.refresh();
  }, []);
  return <Layout />;
}

export default App;
